INSERT INTO `contents` VALUES (1,'wireless internet','Wireless Internet','<p>Merupakan koneksi internet dengan menggunakan media akses berteknologi nirkabel yang dapat diakses selama 24 jam, unlimited dan tanpa batasan quota. Dengan jaringan internet wireless pelanggan akan menerima bandwidth dedicated 1:1 sehingga bandwidth yang didapatkan tidak terbagi dengan pelanggan lain.<p/>\n<p>\n<br/>\n  \n<strong>Benefit Internet Wireless :</strong>\n<br/>\n<br/>\n\n<ol style=\"padding-left:20px;\">\n    <li style=\"list-style-type: number;\">Memberikan jaminan Upload dan Download bandwidth secara simetris.\n</li>\n    <li style=\"list-style-type: number;\">Proses pemasangan cepat dengan hasil yang maksimal.\n</li>\n    <li style=\"list-style-type: number;\">Menjadi solusi terbaik untuk primary link maupun backup link yang paling efisien.\n</li>\n    <li style=\"list-style-type: number;\">Mudah untuk di relokasi atau dipindahkan. Pelanggan dapat membangun Jaringan Interkoneksi untuk menghubungkan kantor pusat dengan kantor cabangnya dimanapun lokasinya.\n</li>\n    <li style=\"list-style-type: number;\">Pelanggan dapat memantau pemakaian internet secara real time melalui online traffic monitoring yang kami sediakan.\n</li>\n</ol>','wireless-internet','2024-06-12 01:05:58.047000','2024-06-15 22:38:34.929000','2024-06-12 01:05:59.971000',1,1),(2,'internet fiber optic','Internet Fiber Optic','<p>Layanan Internet Fiber Optic merupakan solusi bisnis yang sempurna karena memiliki keunggulan dibanding media lainnya. Media ini memberikan solusi dalam hal kecepatan, kehandalan, keamanan, dan kestabilan hingga 99,9%. Infrastruktur Fiber Optic dirancang untuk pengiriman data digital berkecepatan tinggi. Pelanggan dapat menggunakan layanan internet fiber optic selama 24 jam, unlimited tanpa batasan quota.<p/>\n\n<br/>\n\n<strong>Benefit Internet Fiber Optic :</strong>\n<br/>\n<br/>\n\n<ol style=\"padding-left:20px;\">\n    <li style=\"list-style-type: number;\">Memberikan jaminan Upload dan Download bandwidth secara simetris.\n</li>\n    <li style=\"list-style-type: number;\">Pelanggan dapat membangun Jaringan Interkoneksi untuk menghubungkan kantor pusat dengan kantor cabangnya dimanapun lokasinya.\n</li>\n    <li style=\"list-style-type: number;\">Pelanggan dapat memantau pemakaian internet secara real time melalui online traffic monitoring yang kami sediakan.\n</li>\n</ol>','internet-fiber-optic','2024-06-12 01:06:37.676000','2024-06-15 22:27:34.376000','2024-06-12 01:06:38.551000',1,1),(3,'vsat solution','VSAT Solution','Layanan VSAT merupakan solusi terbaik bagi anda yang mempunyai bisnis di daerah yang belum terjangkau media wireless maupun fiber optic. Dengan infrastuktur yang kami miliki bisnis anda akan tetap bisa terhubung dengan jaringan internet melalui teknologi VSAT.','vsat-solution','2024-06-12 01:07:20.861000','2024-06-12 01:33:49.493000','2024-06-12 01:07:21.691000',1,1),(5,'gold','Gold','Bundling Package Gold ini terdiri dari layanan internet dan software seperti yang bisa anda custom sendiri sesuai dengan kebutuhan anda. Paket Gold ini cocok untuk perusahaan anda yang membutuhkan bandwidth internet cukup besar serta software yang beragam untuk memenuhi kebutuhan Teknologi Informasi anda','gold','2024-06-12 01:53:31.076000','2024-06-12 01:53:43.889000','2024-06-12 01:53:43.888000',1,1),(6,'silver','Silver','Bundling Package Silver ini terdiri dari layanan internet dan software yang bisa anda custom sendiri sesuai dengan kebutuhan anda. Paket Silver ini cocok bagi perusahaan Small Medium Business atau yang sedang berkembang untuk memenuhi kebutuhan Teknologi Informasi anda dengan harga yang terjangkau.','si','2024-06-12 01:58:03.168000','2024-06-12 01:58:03.747000','2024-06-12 01:58:03.742000',1,1),(7,'platinum','Platinum','Bundling Package Platinum ini exclusive untuk perusahaan Enterprise yang membutuhkan bandwidth internet yang besar dan tersebar di beberapa cabang perusahaan anda dengan disertai software yang sesuai dengan kebutuhan perusahaan dalam jumlah banyak','platinum','2024-06-12 01:59:05.544000','2024-06-12 01:59:06.129000','2024-06-12 01:59:06.125000',1,1),(8,'solar on-grid pv systems','Solar On-Grid PV Systems','PLTS Terkoneksi Jaringan adalah PLTS yang terhubung dengan jaringan listrik operator. Bekerja pada siang hari, energi yang dihasilkan dapat memenuhi kebutuhan energi yang ramah lingkungan sekaligus menghemat pemakaian listrik dari jaringan operator. Sistem ini dapat digunakan untuk bisnis IPP.','solar-on-grid-pv-systems','2024-06-12 02:08:05.652000','2024-06-12 02:12:05.816000','2024-06-12 02:08:06.747000',1,1),(9,'solar off-grid pv systems','Solar Off-Grid PV Systems','Off grid PV Systems pembangkit listrik tenaga surya mandiri adalah solusi energi terbarukan untuk daerah yang tidak terjangkau oleh jaringan listrik operator. Terdiri dari panel surya, charge controller, inverter, dan penyimpan energi. Energi yang dihasilkan akan disimpan dalam media penyimpanan kemudian disalurkan ke pengguna melalui sistem jaringan tersendiri.','solar-off-grid-pv-systems','2024-06-12 02:13:26.343000','2024-06-12 02:13:26.962000','2024-06-12 02:13:26.960000',1,1),(10,'solar power hybrid system','Solar Power Hybrid System','Hybrid System atau Pembangkit Listrik Tenaga Hibrida (PLTH) merupakan salah satu alternatif sistem pembangkit yang tepat diaplikasikan pada daerah-daerah yang sukar dijangkau oleh sistem pembangkit besar seperti jaringan PLN atau PLTD. PLTH ini memanfaatkan renewable energy sebagai sumber utama (primer) yang dikombinasikan dengan Diesel Generator sebagai sumber energi cadangan (sekunder).','solar-power-hybrid-system','2024-06-12 02:14:14.305000','2024-06-12 02:14:15.119000','2024-06-12 02:14:15.117000',1,1),(11,'rooftop solar power untuk kantor dan rumah','Rooftop Solar Power untuk Kantor dan Rumah','Memanfaatkan atap kantor dan rumah anda sebagai tempat PLTS menjadi solusi untuk keterbatasan lahan terutama di perkotaan. Selain menjadi sumber energi bersih yang dapat menghemat biaya listrik, PLTS Atap juga dapat diintegrasikan untuk menambah keunikan dan keindahan bangunan.','rooftop-solar-power-untuk-kantor-dan-rumah','2024-06-12 02:15:10.758000','2024-06-12 02:15:11.348000','2024-06-12 02:15:11.342000',1,1),(12,'kamuflase pohon tenaga surya','Kamuflase Pohon Tenaga Surya','Solusi yang tepat untuk penerangan jalan. Bersumber dari energi terbarukan yang tidak akan habis dan bebas polusi. Penggunaan yang mudah dan perawatan yang sangat minim menjadikan PJU tenaga surya pilihan yang tepat untuk penerangan jalan, kini dan nanti.','kamuflase-pohon-tenaga-surya','2024-06-12 02:16:01.121000','2024-06-12 02:16:01.673000','2024-06-12 02:16:01.669000',1,1),(13,'umbrella solar power','Umbrella Solar Power','Saung yang dapat menghasilkan listrik tanpa jaringan PLN menggunakan prinsip kerja DC Coupling PLTS Off Grid mengubah energi matahari dengan solar panel tanpa frame dan memanfaatkan baterai sebagai media penyimpanan. Pemanfaatan saung tenaga surya adalah sebagai media promosi dan selain itu tentunya merupakan saung dengan teknologi pengecasan yang bermanfaat untuk keperluan outdoor. Berkapasitas 700 WH ini memiliki 4 output DC dan 1 output AC.','umbrella-solar-power','2024-06-12 02:16:36.366000','2024-06-12 02:16:36.966000','2024-06-12 02:16:36.964000',1,1),(14,'pembangkit listrik tenaga mikro hidro','Pembangkit Listrik Tenaga Mikro Hidro','Mini/micro Hydro Power Plant adalah pembangkit listrik yang menggunakan air sebagai sumber energinya, biasa disebut PLTM (Pembangkit Listrik Tenaga Minihidro) dan PLTMH (Pembangkit Listrik Tenaga Mikrohidro). Di dalam PLTM/PLTMH terdapat komponen turbin dan generator. Air akan dialirkan melewati turbin sehingga turbin berputar. Putaran Turbin akan memutar generator hingga menghasilkan listrik','pembangkit-listrik-tenaga-mikro-hidro','2024-06-12 02:17:31.342000','2024-06-12 02:17:31.900000','2024-06-12 02:17:31.899000',1,1),(15,'cloud services','Cloud Services','Cloud Services\nCloud Services merupakan layanan penyimpanan data dimana perusahaan anda tidak harus membangun infrastruktur sendiri. Dengan Cloud Services perusahaan anda dapat menyederhanakan dan mempermudah kebutuhan Operasional IT anda, tentunya dengan biaya yang lebih hemat.\n\nLayanan :\nWeb Hosting\nApplication\nMail Server\nVirtual Private Server','cloud-services','2024-06-12 02:18:10.194000','2024-06-12 02:18:11.861000','2024-06-12 02:18:11.856000',1,1),(16,'manage service','Manage Service','Manage Service\nKebutuhan Teknologi Informasi yang semakin hari semakin kompleks dapat tertolong dengan solusi Manage Service yang kami tawarkan. Kami menyediakan berbagai macam solusi yang memudahkan pengelolaan kebutuhan IT anda secara efisien serta dapat meningkatkan performa bisnis anda dari sisi Teknologi.\n\nLayanan :\nManage Access Point / WiFi\nManage CCTV\nManage Network\nManage Mailserver','manage-service','2024-06-12 02:18:44.291000','2024-06-12 02:18:44.840000','2024-06-12 02:18:44.836000',1,1);
